import os
import re
from flask import Flask, request, jsonify, render_template
from werkzeug.utils import secure_filename
from datetime import datetime

app = Flask(__name__)
app.config['UPLOAD_FOLDER'] = 'uploads/'
app.config['ALLOWED_EXTENSIONS'] = {'txt', 'csv', 'xlsx'}

def allowed_file(filename):
    return '.' in filename and filename.rsplit('.', 1)[1].lower() in app.config['ALLOWED_EXTENSIONS']

def validate_data(file_path):
    errors = []
    with open(file_path, 'r') as file:
        for line in file:
            if not re.match(r'^[\w\s,]+$', line):
                errors.append(f"Validation error in line: {line.strip()}")
    return errors

def generate_d_file(data):
    filename = f'documentation_{datetime.now().strftime("%Y%m%d%H%M%S")}.txt'
    with open(os.path.join('documents', filename), 'w') as doc_file:
        doc_file.write("Valid Submission Documentation\n")
        doc_file.write("\n".join(data))
    return filename

@app.route('/')
def index():
    return render_template('index.html')

@app.route('/upload', methods=['POST'])
def upload_file():
    if 'file' not in request.files:
        return jsonify({"error": "No file part"}), 400
    file = request.files['file']
    if file.filename == '':
        return jsonify({"error": "No selected file"}), 400
    if file and allowed_file(file.filename):
        filename = secure_filename(file.filename)
        file_path = os.path.join(app.config['UPLOAD_FOLDER'], filename)
        file.save(file_path)

        errors = validate_data(file_path)
        if errors:
            return jsonify({"errors": errors}), 400

        d_file = generate_d_file([f"Valid data from {filename}"])
        return jsonify({"message": "File uploaded successfully", "documentation": d_file}), 200
    return jsonify({"error": "Invalid file format"}), 400

@app.route('/resources', methods=['GET'])
def resources():
    # Placeholder for UI designer's updated resources page
    return render_template('resources.html', title="Updated Resources Page")

def schedule_user_testing():
    testing_date = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    return f"User testing scheduled for {testing_date}"

@app.route('/schedule_testing', methods=['POST'])
def testing():
    testing_details = schedule_user_testing()
    return jsonify({"message": testing_details}), 200

@app.route('/update_validation_rules', methods=['POST'])
def update_validation():
    # Logic to update validation rules can be implemented here
    return jsonify({"message": "Validation rules updated successfully"}), 200

if __name__ == '__main__':
    if not os.path.exists(app.config['UPLOAD_FOLDER']):
        os.makedirs(app.config['UPLOAD_FOLDER'])
    if not os.path.exists('documents'):
        os.makedirs('documents')
    app.run(debug=True)
